import React from "react";
import { useParams } from "react-router-dom";

const RotaDetails = () => {
  const { id } = useParams();

  return (
    <div className="rota-details">
      <h1>Detalhes da Rota</h1>
      <p>ID da Rota: {id}</p>
    </div>
  );
};

export default RotaDetails;
